      out.write("\t\t\t/* if(escape(text.charAt(i)).length == 6){\r\n");
      out.write("\t\t\t\ttextLength++;\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t\ttextLength++;\r\n");
      out.write("\t\t\t*/\r\n");
      out.write("\t\t\tif(encodeURIComponent(text.charAt(i)).length == 9){// 한글\r\n");
      out.write("\t\t\t\ttextLength += 2;\r\n");
      out.write("\t\t\t}else if(encodeURIComponent(text.charAt(i)).length == 1){// 영문\r\n");
      out.write("\t\t\t\ttextLength += 1;\r\n");
      out.write("\t\t\t}else{ //특수문자\r\n");
