      out.write("\r\n");
      out.write("\tfunction cutByLen(str, maxByte) {\r\n");
      out.write("\t\t for(b=i=0;c=str.charCodeAt(i);) {\r\n");
      out.write("\t\t\t b+=c>>7?2:1;\r\n");
      out.write("\t\t\t if(b > maxByte){\r\n");
      out.write("\t\t\t\t break;\r\n");
      out.write("\t\t\t }\r\n");
      out.write("\t\t\t i++;\r\n");
      out.write("\t\t }\r\n");
      out.write("\t\t return str.substring(0,i);\r\n");
      out.write("\t }\r\n");
