      out.write("\t\t\t\t\t\t\t\t<p class=\"mt05\">개인정보처리시스템에 접속한 기록을 최소 6개월 이상 보관, 관리하고 있으며, 접속 기록이 위,변조 및 도난, 분실되지 않도록 보안기능 사용하고 있습니다.</p>\r\n");
      out.write("\t\t\t\t\t\t\t\t<p class=\"mt05\">6. 개인정보에 대한 접근 제한</p>\r\n");
      out.write("\t\t\t\t\t\t\t\t<p class=\"mt05\">개인정보를 처리하는 데이터베이스시스템에 대한 접근권한의 부여,변경,말소를 통하여 개인정보에 대한 접근통제를 위하여 필요한 조치를 하고 있으며 침입차단시스템을 이용하여 외부로부터의 무단 접근을 통제하고 있습니다.</p>\r\n");
      out.write("\t\t\t\t\t\t\t\t<p class=\"mt05\">7. 문서보안을 위한 잠금 장치 사용</p>\r\n");
      out.write("\t\t\t\t\t\t\t\t<p class=\"mt05\">개인정보가 포함된 서류, 보조저장매체 등을 잠금 장치가 있는 안전한 장소에 보관하고 있습니다.</p>\r\n");
      out.write("\t\t\t\t\t\t\t\t<p class=\"mt05\">8. 비 인가자에 대한 출입 통제</p>\r\n");
      out.write("\t\t\t\t\t\t\t\t<p class=\"mt05\">개인정보를 보관하고 있는 물리적 보관 장소를 별도로 두고 이에 대해 출입통제 절차를 수립, 운영하고 있습니다.</p>\r\n");
      out.write("\t\t\t\t\t\t\t\t<em class=\"mt20\">8. 개인정보 보호책임자 작성</em>\r\n");
      out.write("\t\t\t\t\t\t\t\t<p class=\"mt05\">① inus 서비스센터(‘http://cs.inusbath.com’이하 ‘inus 서비스센터 홈페이지) 은(는) 개인정보 처리에 관한 업무를 총괄해서 책임지고, 개인정보 처리와 관련한 정보주체의 불만처리 및 피해구제 등을 위하여 아래와 같이 개인정보 보호책임자를 지정하고 있습니다.</p>\r\n");
      out.write("\t\t\t\t\t\t\t\t<p class=\"mt05\">▶ 개인정보 보호책임자</p>\r\n");
